var gr = new GlideRecord('alm_asset');
if (gr.get(current.variables.asset + '')) {
    if (gr.install_status == '6' && gr.substatus == 'available') //checks if asset state is in stock and sub state is availalbe
	{ 
        activity.result = 'Asset checked-in';
    updateTask();
    } else
        activity.result = 'Asset not checked-in';
}

function updateTask(){
	var grtask = new GlideRecord("sc_task");
grtask.addQuery("request_item", current.sys_id+'');
grtask.query();
if (grtask.next()) {
grtask.state = 3;
	grtask.update();
}

}

